DROP TABLE IF EXISTS "version";
CREATE TABLE "version" ("id" integer NOT NULL PRIMARY KEY, "article_id" integer NOT NULL, "v" varchar(255) NOT NULL UNIQUE, "title" varchar(255) NOT NULL, "byline" varchar(255) NOT NULL, "date" datetime NOT NULL, "boring" bool NOT NULL DEFAULT 0, "diff_json" varchar(255) NULL);
